import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import {
Container,
} from 'react-bootstrap'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import './UserHome.css'

class Recents extends Component {
    constructor(props) {
        super(props);
        this.state = {
            cid : '',
            cname : '',
            clocation : '',
            cprice : '',
            fid: this.props.id,
        };
    }

    componentDidMount() {
        const url = 'http://localhost:9000/getcrops/'
        console.log(this.props.fid)

        fetch(url+this.state.fid)
        .then(response => {if(response.ok){
            result = response.arrayBuffer()
            .then(result => {
              this.state.cid = result.id
              this.state.cname = result.name
              this.state.clocation = result.location
              this.state.cprice = result.price
              console.log(this.state)

            })  
        } 
        })
        .catch(() => console.log("can't access" + url + "response."))        
    }

    render(){
        return (
            <div class = "recentbids">
                <Container>
                    <Row>
                        {this.state.data}
                    </Row>
                    <Row>

                        Crop 1
                        {/*<Col>{this.state.cname}</Col>
                        <Col>{this.state.clocation}</Col>
        <Col>{this.state.cprice}</Col>*/}

                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 2
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 3
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 4
                    </Row>
                    <Row>
                        {this.state.data}
                        Crop 5
                    </Row>

                </Container>
            </div>
        );
    }
}

export default Recents;
